package LeetCode;

import java.util.Arrays;
import java.util.Collections;
import java.util.HashMap;
import java.util.Map;

public class ReconstructOriginalDigitsfromEnglish {

    int [] index = {0,2,6,8,3,7,9,5,4,1};
    String [] dict = {"zero","two","six","eight","three","seven","nine","five","four","one"};
    public String originalDigits(String s) {
        int[] input = new int[26];
        char[] inp = s.toCharArray();
        StringBuilder result = new StringBuilder();
        for (int i = 0; i < inp.length; i++) {
            input[inp[i] - 'a']++;
        }

        for (int i1=0;i1<10;i1++) {
            char []entry = dict[i1].toCharArray();
            boolean found = true;

            int[] t = new int[26];
            for (int i = 0; i < entry.length; i++) {
                t[entry[i] - 'a']++;
            }

            while (found) {
                for (int i = 0; i < 26; i++) {
                    if (t[i] > input[i]) {
                        found = false;
                        break;
                    }
                }
                if (found) {
                    for (int i = 0; i < 26; i++) {
                        input[i] -= t[i];
                    }
                    result.append(index[i1]);
                }
            }
        }

//        for(int i=0.i<input.length;i++){
//            if(){
//
//            }
//        }
        char []sort = result.toString().toCharArray();
        Arrays.sort(sort);
        return new String(sort);
    }

    public static void main(String[] args) {
        ReconstructOriginalDigitsfromEnglish inst = new ReconstructOriginalDigitsfromEnglish();
        System.out.println(inst.originalDigits(""));
        //"01113356"
        //"0123456789"
    }
}
